import React, { Component } from "react";
import { Container, Row, Col } from "react-bootstrap";
import arrow from "../../assets/icons/returnArrow.svg";
import "./styles.css";

class HeaArrow extends Component {
  constructor(props) {
    super(props);
    this.goBack = this.goBack.bind(this);
  }
  goBack() {
    this.props.history.goBack();
  }

  render() {
    return (
      <Container>
        <Row className="justify-content-md-center header-div">
          <Col xs={3} md={12}>
            <img src={arrow} className="icon-arrow" onClick={this.goBack}></img>
          </Col>
        </Row>
      </Container>
    );
  }
}
export default HeaArrow;
